<span id="span"
style="position: absolute;
    top: 662px;
    left: 106px;
    font-family: Gluten,cursive;
    font-size: 35px;
    font-weight: bold;
    color: bisque;">

</span>
<script>
  msg = [
    {
      text:"Hello Kate, how Are you ?",
      weight:1
    },{
      text:"I'm bored...",
      weight:1
    },{
      text:"What a cool day !",
      weight:1
    },{
      text:"I wish i were a unicorn.",
      weight:1
    },{
      text:"Poodidoowaaah !",
      weight:1
    },
  ]
  if(metadata.properties?.messages){
    msg = metadata.properties.messages;
  }
  function getRandomEvent(){

    let span = document.getElementById("span")

    let ranTxt = Math.trunc(Math.random()*5)

    for(let i=0;i<msg.length;i++){
      if(ranTxt === i){
        span.innerHTML=msg[ranTxt].text
      }

    }

    let ran = Math.trunc(Math.random()*6)
    switch (ran) {
      case 0:
        hz(200)
        break
      case 1:
        hz(90)
        break
      case 2:
        vt(200)
        break
      case 3:
        vt(90)
        break
      case 4:
        rotate(10)
        break
      case 5:
        rotate(5)
        break
      default:
        ran=-1
        r=-1

    }
  }

    function hz(ms) {
      console.log("gauche, droite, gauche, droite");

      let pny = document.getElementById('pny')
      let pos = 0;
      let inter = setInterval(mvt, ms);
      let i=0;
      function mvt () {
        if(i===8){
          pos = pos + 10;
          pny.style.x = pos;
          clearInterval(inter)
        } else if (i === 0){
          pos = pos + 10;
          pny.style.x = pos;
        } else if (pos===10) {
            pos = pos - 10;
            pny.style.x = pos;
          } else if (pos===-10) {
          pos = pos + 10;
          pny.style.x = pos;
        } else if(i%4===0){
            pos = pos + 10;
            pny.style.x = pos;
          } else {
          pos = pos - 10;
          pny.style.x = pos;
        }
        i++
      }
    }

    // vert

    function vt(ms) {
      console.log("haut, bas, haut, bas");

      let pny = document.getElementById('pny')
      let pos = 0;
      let inter = setInterval(mvt, ms);
      let i=0;
      function mvt () {
        if(i===8){
          pos = pos + 10;
          pny.style.y = pos;
          clearInterval(inter)
        } else if (i === 0){
          pos = pos + 10;
          pny.style.y = pos;
        } else if (pos===10) {
          pos = pos - 10;
          pny.style.y = pos;
        } else if (pos===-10) {
          pos = pos + 10;
          pny.style.y = pos;
        } else if(i%4===0){
          pos = pos + 10;
          pny.style.y = pos;
        } else {
          pos = pos - 10;
          pny.style.y = pos;
        }
        i++
      }
    }

    function rotate(ms) {

      console.log("click")
      // let pny = document.getElementById('pny')
      // pny.style.transform = "rotate(15,640,320)"
      // console.log(pny)

      let i=0;
      let j=0;
      let k=0;
      let deg=7;

      let dod = setInterval(
        doodle
        ,ms
      )

      function doodle () {          // deg =
        if(k===3 && i===0){
          clearInterval(dod)
        }
          if (i===deg){
            if(j===-deg){
            k++;
              i=-deg
              j=deg
            } else {
              console.log(j)
              document.getElementById("_Image2").style.transform="rotate("+j+"deg)";
              j--
            }
          } else {
            console.log(i)
            document.getElementById("_Image2").style.transform = "rotate(" + i + "deg)";
